class Hari extends React.Component{
    constructor(){
        super();
        this.state={
        name:"hari",
        city:"bangalore",
        role:"react",
        company:"protiviti"

        }
    }
    render(){
        return(
            <div>
                {this.state.name}<br></br>
                {this.state.city}<br></br>
                {this.state.role}<br></br>
                {this.state.company}<br></br>

            </div>
        )
    }
}
export default Hari;
